description:
Verenigd Koninkrijk
Horror / Thriller
91 minuten

zeer goeie film en een goed verhaal

met Michael Fassbender, Kelly Reilly en Jack O'Connell

Lerares Jenny en haar vriend Steve gaan er een weekendje tussenuit naar het idyllische Eden Lake. Hun rust wordt echter al snel 
verstoord door een groepje vervelende tieners. Kleine pesterijtjes monden al gauw uit in levensgevaarlijke situaties voor het 
stel.
